import React, { Component } from 'react';
import './Complete.css';
import { connect } from 'react-redux'
import { add_array, add_item } from '../actions/data'

class Complete extends Component {

    constructor(props) {
        super(props); 
      }
    
    
      render() {
    
    
        return (
          <div className="Complete">
            <header className="Complete-header">
            <div className="text-container">
              <p className="Complete-text">
                Congratulations
                <br /><br /> You have completed the practice trial
                <br /><br /> You responses have been recorded:
                <br /><br />
                { this.props.data.responses_1 }
                <br /><br />
                { this.props.data.response_time_1 }
                <br /><br />
                { this.props.data.response_time_1 }
              </p>
            </div>     
            </header>
          </div>
        );
      }
    }

const mapStateToProps = state => ({
  data: state.data,
})

const mapDispatchToProps = dispatch => ({
  add_item: () => dispatch(add_item()),
  add_array: () => dispatch(add_array()),
})
    
export default connect(mapStateToProps, mapDispatchToProps)(Complete)
